import productImage from '../images/phantom2.png';

const Card = ({ itemData }) => {
    console.log("this is card", itemData);
    const { brand, image } = itemData;
    console.log(image);
    return (
        <div>
            <img src={require(image)} />
            <h1>{itemData.productName}</h1>
            <p>{itemData.price} {itemData.unit}</p>
            <p>{brand}</p>
        </div>
    )
}

export default Card;
